import React, { useState } from 'react';
import { Modal, Button, Form } from 'react-bootstrap';
 
const NewBlogPostModal = ({ show, handleClose, setData, imgSrc }) => {
  const [formData, setFormData] = useState({
    selectedImage: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };
 
  const handleImageChange = (e) => {
    const selectedImage = e.target.files[0];
    setFormData({
      ...formData,
      selectedImage,
    });
  };
 
  return (
    <div className="model_box">
      <Modal show={show} onHide={handleClose} backdrop="static" keyboard={false}>
        <Modal.Header closeButton>
          <Modal.Title>New Post</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <form>
          <div className="form-group mt-3">
        <label>Upload Image:</label>
        <p></p>
        <input
          type="file"
          accept=".jpg, .jpeg, .png, .gif"
          onChange={handleImageChange}
        />
      </div>

      <div className="form-group mt-3" style={{ display: 'none' }}>
        <label>Image Source:</label>
        <input
          type="text"
          className="form-control"
          name="imgSrc"
          value={imgSrc}
          onChange={handleChange}
          placeholder="Image Source (URL)"
          required
        />
      </div>
            <div className="form-group mt-3">
              <input
                type="text"
                className="form-control"
                name="imgAlt"
                value={formData.imgAlt}
                onChange={handleChange}
                placeholder="Image Alt Text"
                required
              />
            </div>
            <div className="form-group mt-3">
              <input
                type="text"
                className="form-control"
                name="title"
                value={formData.title}
                onChange={handleChange}
                placeholder="Title"
                required
              />
            </div>
            <div className="form-group mt-3">
              <input
                type="text"
                className="form-control"
                name="subtitle"
                value={formData.subtitle}
                onChange={handleChange}
                placeholder="Subtitle"
                required
              />
            </div>
            <div className="form-group mt-3">
              <textarea
                className="form-control"
                name="text"
                value={formData.text}
                onChange={handleChange}
                placeholder="Text"
                required
              />
            </div>
            <div className="form-group mt-3">
              <input
                type="text"
                className="form-control"
                name="buttonText"
                value={formData.buttonText}
                onChange={handleChange}
                placeholder="Button Text"
                required
              />
            </div>
            <div className="form-group mt-3">
              <input
                type="text"
                className="form-control"
                name="buttonRedirectURL"
                value={formData.buttonRedirectURL}
                onChange={handleChange}
                placeholder="Button Redirect URL"
                required
              />
            </div>
            <button
      type="submit"
      className="btn btn-success mt-4"
      onClick={() => handleImageUpload(formData, setData, handleClose)}
    >
      Adaugare
    </button>
          </form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Inchidere
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}
 
export default NewBlogPostModal;
